import React from "react";

const Modal = ({ imageUrl, closeModal }) => {
  return (
    <div className="modal">
      <span className="close" onClick={closeModal}>&times;</span>
      <img src={imageUrl} alt="Full Size Image" className="modal-image" />
    </div>
  );
};

export default Modal;
